console.clear();
function orbitalPeriod(arr) {
  var GM = 398600.4418;
  var earthRadius = 6367.4447;
  arr.map(obj => {
  let orbit = 2 * Math.PI * Math.pow( Math.pow((earthRadius + obj["avgAlt"]),3) /GM, 0.5)
  obj["orbitalPeriod"] = Math.round(orbit);
  delete obj["avgAlt"];
  });
  return arr
}

